  [],\n\t\"revision_timestamp\": \"2015-05-06T21:46:48.058350\",\n\t\"name\": \"miniature-x-ray-source-for-planetary-exploration-instruments-project-b2dcc\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The objective of the proposed work is to
  develop a rugged, low power, passively cooled X-Ray source that is compatible with
  miniaturized XRD systems.  The XRD instruments would be used for in situ measurements
  on planetary surfaces. This X-ray source will integrate an X-ray emitting vacuum
  tube and both low and high-voltage power supplies into a compact and lightweight
  unit. This X-ray source will enable further miniaturized X-ray instruments to be
  deployed for surface and subsurface exploration of the solar system. rnrnThe objectives
  will be achieved with an X-ray source that combines the advantage of easy thermal
  management and simple control electronics. The concept relies on the use of state-of-the-art
  ceramic materials that combines very good electrical insulation properties with
  good thermal conductivity. This source will allow using the grounded-cathode geometry
  for simple and compact electronics, and rely on the heat-sinking properties of the
  electrical insulator for heat dissipation to ground. The most promising material
  for this application is Aluminum Nitride (AlN). Objective specifications for the
  source to be developed are as follows: rnAccelerating Voltage (25 kV), Electron
  Beam Current (200 uAmps), X-ray Spot Size (50 microns), X-ray Tube Dimensions (65
  mm x 25 mm,lxd) rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
